import "./Fond.scss";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import Section4 from "../components/Section4";
import Section5 from "../components/Section5";
import { NavLink, withRouter } from "react-router-dom";
import { connect } from "react-redux";

import React, { useState, useEffect } from "react";
import { Trans,Translation } from "react-i18next";
import i18n from '../i18n';
import $ from "jquery";

function Fond({ text5 = [], displaymode1, fond }) {
  useEffect(() => {
    $(".navbar").css("position", displaymode1);
  });
  return (
    <>
      <Navbar />
      <div id="up" className="Fond" >
        <div className="gif">
          <img
            className="img1"
            src="https://i.ibb.co/tPBnk9P/qafqaz.gif"
            alt=""
          /> 
        </div>
          <h1 id = "Fond">Fond</h1>
        <div className="sectionone">
          <div className="text">
            <div className="first-div">
            {t('Amazon is rolling out a new Prime Video feature that lets users share video clips from TV shows and movies on the platform. The clips can be shared on social media.')}
              
            </div>
            <div className="second-div">
              Number of shows, including season one of “The Boys,” “The Wilds,”
              “Invincible” and “Fairfax.” When you’re watching one of these four
              titles, you can click on the new “Share.{" "}
            </div>
          </div>
          <img src="https://cdn.wallpapersafari.com/95/60/iQbLIK.jpg" />
        </div>
     
      

       
      </div>
      <Section5 />
      <Section4 />
      <Footer />
    </>
  );
}

const mapStateToProps = (state, ownProps) => {
  return {
    text5: state.text5,
    displaymode1: state.displaymode1,
    fond: state.fond
  };
};

export default connect(mapStateToProps)(Fond);
